import React, {FC} from 'react';
import Layout from 'components/global/layout';
import EditPost from 'api/PublicTransportAPIs/editpostAPI';
import EditPostContext from 'api/context/PublicTransportContext/EditPostContext';
import './styles.scss';

interface IProps {};

export const PublicTransport: FC<IProps> = () => (
  <Layout title="PublicTransport" description="This is the PublicTransport Page">
   <EditPostContext.Provider>
     <EditPost />
   </EditPostContext.Provider>
  </Layout>
);

export default PublicTransport;
